import React from 'react';
import Home from './components/Home';
import { BrowserRouter as Router, Route } from 'react-router-dom';

import VendorPage from './VendorPage'; // assuming VendorPage is the component for vendor details


const App = () => {
  return (
    <Router>
      <Route path="/" exact component={Home} />
      <Route path="/become-a-vendor" component={VendorPage} />
    </Router>
  );
};

export default App;
